import React, { useEffect } from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faBars } from '@fortawesome/free-solid-svg-icons'
import { getStorage, ref, getDownloadURL } from 'firebase/storage'

function MyMusic(props) {

  const storage = getStorage();
  useEffect(() => {
    getDownloadURL(ref(storage, 'DUCKWORTH.mp3'))
    .then((url) => {
      const test = new Audio(url)
      test.play()
      document.querySelector('.audioplayer').setAttribute('src', url)
      props.setSong(url)
    })
  });
  return (
    <div className='home'>
      <h3 id="h3music">My Music</h3>
      <FontAwesomeIcon className='hamburger floatingHamburger' icon={faBars} onClick={props.toggleFun} />
    </div>
  )
}

export default MyMusic
